if (!defined('FOXXEY')) {
	die ('{"message": "Not in FOXXEY thread"}');
} else {
	$this->tpl = new Smarty;
	$smartyInit = new smartyInit($this->tpl);
}
	class smartyInit extends init {
		
		protected $smarty;
		
		function __construct($tpl) {
			global $config;
			init::requireNestedClasses(basename(__FILE__), __DIR__);
			init::classUtil('CheckUserAccess', "1.0.0");
			init::classUtil('PluginScanner', "1.2.7-exp");
			define('UserUploadDir', UPLOADS_DIR.USR_SUBFOLDER.init::$usrArray['login'].'/');
			$this->smarty 					= $tpl;
			$this->smarty->debugging 		= false;
			$this->smarty->cache_lifetime 	= 120;
			$this->smarty->template_dir 	= ROOT_DIR.'/templates/'.$config['siteTpl'];
			$this->smarty->compile_dir 		= ENGINE_DIR.'/cache/compile/';
			$this->smarty->cache_dir 		= ENGINE_DIR.'/cache/cache/';
			$this->smartyAssign();
			$this->smarty->display('main.tpl');
		}
		
		protected function smartyAssign(){
			global $config;
			$smartyUtils = new smartyUtils;
			$PluginsScanner = new PluginsScanner(PLUGINS_DIR);
			
			//@Deprecated
			$this->smarty->assign("year", date("Y"));
			$this->smarty->assign("tplDir", "/templates/".$config['siteTpl']);
			$this->smarty->assign("webserviceName", $config['webserviceName']);
			$this->smarty->assign("isLogged",   init::$usrArray['isLogged']);
			$this->smarty->assign("builtInJS", $smartyUtils->assignJs());
			$this->smarty->assign("systemHeaders", $PluginsScanner->outString);
			$this->smarty->assign("isMobile", init::$deviceType->isMobile());
			
			$smartyUtils->assignUserFields($this->smarty);
			$this->readTplVars();			
			return $this->smarty;
		}

		private function readTplVars() {
			global $config;
			$readArray = array("siteTitle", "siteStatus", "siteDesc", "keywords", "contactEmail", "contactPhone", "ServiceVersion");
			foreach($readArray as $val){
				$this->smarty->assign($val, $config[$val]);
			}
		}	
	}